pragma solidity >=0.8.7;

contract UiamContract
{
    User[] public users;
    uint256 public nextId;
    bool public isVerfied=false;
    uint256 public username;
    constructor(){
        username;
        nextId = 0;
        isVerfied;

        
    }
    struct User
    {
        uint id;
        string uid;
        string detailHash;
    }

    function Create(string memory newUid, string memory newDetailHash)public
    {
        users.push(User({id:nextId,uid:newUid,detailHash:newDetailHash}));

        nextId++;
    }



    //function read(string memory newUid, string memory newDetailHash) view public returns(string memory,string memory)
    //{
        
    //    uint i = find(newUid,newDetailHash);
    //    return( users[i].uid,users[i].detailHash);
            
    //}

    //function update(string memory newUid, string memory newDetailHash)public
    //{
        
    //    uint i = find(newUid,newDetailHash);
    //    users[i].uid = newUid;
    //    users[i].detailHash = newDetailHash;
                
         
    //}

    //function destroy(string memory newUid, string memory newDetailHash) public
    //{
    //    uint i = find(newUid,newDetailHash);
    //    delete users[i];
    //}

    function find(string memory newUid, string memory newDetailHash) public 
    {
        
        for(uint i = 0;i<users.length;i++)
        {
            if(keccak256(abi.encodePacked(users[i].uid)) == keccak256(abi.encodePacked(newUid)) && keccak256(abi.encodePacked(users[i].detailHash)) == keccak256(abi.encodePacked(newDetailHash)))
            {
                isVerfied = true;
                break;
            }
            username = users.length;
    
            isVerfied = false;
        }

    }


}
